import React from 'react';
import './App.css';
import FormPropsTextFields from './InputBox'
import ButtonAppBar from "./appbar";
import Box from "@material-ui/core/Box";

function App() {
    return (
        <div className="App">
            <div>
                <ButtonAppBar/>
            </div>
            <Box component="span" m={1}>

            <div className="leftside">
                <FormPropsTextFields/>
                <FormPropsTextFields/>
                <FormPropsTextFields/>
                <FormPropsTextFields/>
                <FormPropsTextFields/>
            </div>

            <div className="rightside">
                <FormPropsTextFields/>
                <FormPropsTextFields/>
                <FormPropsTextFields/>
                <FormPropsTextFields/>
                <FormPropsTextFields/>
            </div>
            </Box>

        </div>
    );
}

export default App;
